// src/Welcome.js
import React from 'react';
import {Link} from 'react-router-dom';

const Welcome = () => {
    return (
      <div className="App">
        <div className="header">
          <h1>Welcome to the Daily Quotes App!</h1>
        </div>
        <div className="main-content">
          <p>We deliver inspiring quotes to you daily at your preferred time.</p>
        </div>
        <div className="footer">
            <button>Continue to Set Time</button>
        </div>
      </div>
    );
  };
  
  export default WelcomePage;
